<!DOCTYPE html>
<html lang="en">
<head>
	<meta charset="UTF-8">
	<title>space</title>
</head>
<body>
	<style>
		:root{
            --width: 800px;
            --color-background: #101535;
        }
        *{
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        body{
            background-color: var(--color-background);
        }
		.space-animation{
            width: var(--width);
            height: calc( var(--width) * 0.5775);
            position: absolute;
            right: 0;
            bottom: 5em;
        }
        .space-animation video{
            width: 80%;
            height: 90%;
            object-fit: cover;
        }
        .space-animation svg{
            width: 100%;
            position: absolute;
            left: 0;
            top: 0;
        }
        .space-animation svg rect{
            fill: var(--color-background);
        }
	</style>

	<div class="space-animation">
        <video autoplay playsinline muted loop preload>
            <source src="space.mp4">
        </video>

                    .space-animation .cls-19 {

                    .space-animation .cls-20 {
                        fill: #4c2dcf;
                    }

                    .gravity{
                        animation: spaceGravity 3s linear infinite alternate;
                    }
                    .cls-18.gravity{
                        animation: spaceGravity 3s linear infinite alternate-reverse;
                    }
                    .gravity.fast{
                        animation-duration: 2s;
                    }
                    .human.gravity{
                        animation: human_gravity 3s infinite alternate;
                    }
                    @keyframes spaceGravity{
                        0%{
                            transform: translate(0px, 0px);
                        }
                        100%{
                            transform: translate(5px, 20px);
                        }
                    }
                    @keyframes human_gravity{
                        0%{
                            transform: translate(0px, 0px);
                        }
                        100%{
                            transform: translate(5px, 10px) rotate(-1deg);
                        }
                    }

                    .hose{
                        transform: translate(0px, -30px);
                        animation: hose 3s ease infinite alternate;
                    }
                    @keyframes hose{
                        0%{
                            transform: translate(0px, -30px);
                        }
                        100%{
                            transform: translate(20px, -30px);
                        }
                    }
